          hess(:) = hess(:) + rphase(:)*(-(fun*rmu(:, 0)*rmucos(:, 0)*&
&            sinphase(:, 0))-distp(0, 1)*cosphase(0)*rphase(:))*rmucos(ic&
&            , 0)*rmu(ic, 0)
