          temp92 = fun*rmu(ic, 0)
          temp94 = temp92*rmucos(ic, 0)
          temp89 = fun*rmu(ic, 0)
          temp91 = temp89*rmucos(ic, 0)
          temp87 = distp(0, 1)/cellscale(ic)
          temp85 = rmucos(:, 0)**2
          temp84 = rmu(:, 0)**2
