        fun = -(distp(0, 1)*r(0)*(c0*r(0)*(rp1-4.d0)+c1*(rp1-3.d0)))
        fun3 = distp(0, 1)*(c0*(8.d0-7.d0*rp1+rp2)+c1*(3.d0-5.d0*rp1+rp2&
