        hess(:) = (fun3*rmu(:, 0)**2*rmucos(:, 0)**2+fun*(1.d0-2.d0*&
&          rmusin(:, 0)**2))*cosphase(0)
        hess(:) = hess(:) - 2.d0*fun*rmu(:, 0)*rmucos(:, 0)*sinphase(:, &
&          0)*rphase(:) - cosphase(0)*fun0*rphase(:)**2
