!         if(iflagnorm.gt.2) then
! overall normalization
!         c=8.d0/dsqrt(15.d0)*(2.d0/pi)**(3.d0/4.d0)*dd1**(9.d0/4.d0)
    c = dd1**2.25d0*1.47215808929909374563d0
!         endif
! radial part
