                der4f(2) = fun0*der4f(2)
                CALL PUSHREAL8(adr8ibuf,adr8buf,hess4f(2))
                hess4f(2) = -(6.d0*fun0*cost2f*rmu(1, 0)*rmucos(1, 0)*(&
&                  2.d0*rmucos(1, 0)**2-1.d0)) - 4.d0*pi**2/cellscale(1)&
&                  **2*fun0*cost2f*rmu(1, 0)*rmucos(1, 0)*(5.d0*rmu(3, 0)&
