                CALL PUSHINTEGER4(adi4ibuf,adi4buf,8)
              ELSE IF (i .EQ. 2) THEN
                CALL PUSHREAL8(adr8ibuf,adr8buf,der4f(2))
                der4f(2) = -(2.d0*cost2f*rmu(2, 0)**2*rmucos(2, 0)**2) +&
