                CALL PUSHREAL8(adr8ibuf,adr8buf,der4f(2))
                der4f(2) = fun0*der4f(2)
                CALL PUSHREAL8(adr8ibuf,adr8buf,hess4f(2))
                hess4f(2) = -(4.d0*fun0*cost3f*pi/cellscale(3)*rmusin(3&
