            ELSE IF (ic .EQ. 5) THEN
              IF (i .EQ. 1) THEN
                CALL PUSHREAL8(adr8ibuf,adr8buf,der4f(2))
                der4f(2) = 2.d0*cost3f*rmu(2, 0)*rmucos(2, 0)*rmu(3, 0)*&
