                CALL PUSHREAL8(adr8ibuf,adr8buf,hess4f(2))
                hess4f(2) = -(8.d0*cost3f*fun0*pi/cellscale(i)*rmu(2, 0)&
&                  *rmucos(2, 0)*rmu(3, 0)*rmucos(3, 0)*rmusin(i, 0)*&
&                  rmucos(i, 0))
                CALL PUSHINTEGER4(adi4ibuf,adi4buf,15)
              ELSE IF (i .EQ. 2) THEN
