            ELSE IF (ic .EQ. 6) THEN
              IF (i .EQ. 1) THEN
                CALL PUSHREAL8(adr8ibuf,adr8buf,rp1)
                rp1 = cost4g*3.d0*((rmu(1, 0)*rmucos(1, 0))**2-(rmu(2, 0&
&                  )*rmucos(2, 0))**2)*rmu(3, 0)*rmucos(3, 0)
                CALL PUSHREAL8(adr8ibuf,adr8buf,rp2)
