!laplacian
! d^2/dx^2_k \Psi(x_i) = (d^2/dx^2_k F(X_i(x_i))) \phi(x_i)
!                      + 2.d0 (d/dx_k F(X_i(x_i)))  d/dx_k \phi(x_i)
!                      + F(X_i(x_i)) d^2/dx^2_k \phi(x_i)
