                CALL PUSHREAL8(adr8ibuf,adr8buf,der4f(2))
                der4f(2) = cost3d*rmu(3, 0)*rmucos(3, 0)*(rmucos(2, 0)**&
&                  2-rmusin(2, 0)**2)
