              ELSE IF (i .EQ. 3) THEN
                CALL PUSHREAL8(adr8ibuf,adr8buf,der4f(2))
                der4f(2) = 8.d0*cost2f*rmu(1, 0)*rmucos(1, 0)*rmu(3, 0)*&
