            ELSE IF (ic .EQ. 3) THEN
              IF (i .EQ. 1) THEN
                CALL PUSHREAL8(adr8ibuf,adr8buf,der4f(2))
                der4f(2) = -(2.d0*cost2f*rmu(1, 0)*rmucos(1, 0)*rmu(2, 0&
